

# 生成随机的密钥（必须是16、24或32字节）

# data = ''
# 明文数据
from Crypto.Cipher import AES
from Crypto.Util.Padding import unpad
import base64


def aes_ecb_decrypt(encrypted_base64: str, key_base64: str) -> str:
    """
    AES-ECB模式解密函数
    :param encrypted_base64: Base64编码的密文
    :param key_base64: Base64编码的密钥（支持128/192/256位）
    :return: 解密后的明文（UTF-8字符串）
    """
    # 密钥处理（Base64转字节）
    key = base64.b64decode(key_base64)

    # 创建AES解密对象（ECB模式不需要IV）
    cipher = AES.new(key, AES.MODE_ECB)

    # 密文解码与解密
    encrypted_bytes = base64.b64decode(encrypted_base64)
    decrypted_bytes = cipher.decrypt(encrypted_bytes)

    # 去除PKCS7填充[2,6](@ref)
    plaintext_bytes = unpad(decrypted_bytes, AES.block_size)

    return plaintext_bytes.decode('utf-8')


# 示例用法
if __name__ == "__main__":
    # key = 'hTJq3iM8GFFcnWXVry3WoA=='
    key = 'r7oVPm0XXgsL80AHeyi9nQ=='
    # data = ''
    data =''

    print(len(data) / 4)
    encrypted_data = data
    secret_key = key
    result = aes_ecb_decrypt(encrypted_data, secret_key)
    print(11111,result)

